import React, { lazy, Component } from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect
} from "react-router-dom";
import { NotificationProvider } from "./Common/Util/NotificationSocket";
import WizAppModalProvider from "./Common/Util/WizAppModalProvider";
import SuspenseWrapper from "./Common/Util/SuspenseWrapper";
import UserRoute from "./Common/Util/UserRoute";
import CheckIE from "./Common/Util/CheckIE";
import { SubscribeManager } from "./Common/Util/Subscribe";
import Home from "./Page/Home";

const Builder = lazy(() => import("./Page/Builder"));
const Builder3D = lazy(() => import("./Page/Builder3D"));
const EditorRecommand = lazy(() => import("./Page/EditorRecommand"));
const Social = lazy(() => import("./Page/Social"));
const SocialWrite = lazy(() => import("./Page/Social/ArticleWrite"));
const Event = lazy(() => import("./Page/Event"));
const Event1 = lazy(() => import("./Page/Event/Event1"));
const Event2 = lazy(() => import("./Page/Event/Event2"));
const Event4 = lazy(() => import("./Page/Event/Event4"));
const Event5 = lazy(() => import("./Page/Event/Event5"));
const EventEnd0 = lazy(() => import("./Page/Event/EventEnd0"));
const EventEnd1 = lazy(() => import("./Page/Event/EventEnd1"));
const EventEnd2 = lazy(() => import("./Page/Event/EventEnd2"));
const EventEnd5 = lazy(() => import("./Page/Event/EventEnd5"));
const EventEnd6 = lazy(() => import("./Page/Event/EventEnd6"));
const EventEnd7 = lazy(() => import("./Page/Event/EventEnd7"));
const Support = lazy(() => import("./Page/Support"));
const Mypage = lazy(() => import("./Page/Mypage"));
const Subscribe = lazy(() => import("./Page/Mypage/Components/Subscribe"));
const Userpage = lazy(() => import("./Page/Userpage"));
const History = lazy(() => import("./Page/History"));
const IconSetting = lazy(() => import("./Page/Mypage/Components/IconSetting"));
const Notification = lazy(() => import("./Common/Component/Layout/Notification"));
const WizAppMode = lazy(() => import("./Common/Component/WizAppMode"));
const GamePlayer = lazy(() => import("./Page/GamePlayer"));
const OCP2Event = lazy(() => import("./Page/Event/OCP2"));
const Challenge = lazy(() => import("./Page/Challenge"));
const ChallengeReview = lazy(() => import("./Page/ChallengeReview")); // temp challenge review
const ChallengeMyProjectList = lazy(() => import("./Page/ChallengeMyProjectList"));
const ChallengeProjectDetail = lazy(() => import("./Page/ChallengeProjectDetail"));
const ChallengeApply = lazy(() => import("./Page/ChallengeApply"));
const GstarChallenge = lazy(() => import("./Page/Gstar/Challenge"));
const GstarChallengeReview = lazy(() => import("./Page/Gstar/ChallengeReview")); // temp challenge review
const GstarChallengeMyProjectList = lazy(() => import("./Page/Gstar/ChallengeMyProjectList"));
const GstarChallengeProjectDetail = lazy(() => import("./Page/Gstar/ChallengeProjectDetail"));
const GstarChallengeApply = lazy(() => import("./Page/Gstar/ChallengeApply"));
const Payment = lazy(() => import("./Page/Payment"));
const PaymentResult = lazy(() => import("./Page/PaymentResult"));
const MyAPK = lazy(() => import("./Page/MyAPK"));
const CreateAPK = lazy(() => import("./Page/MyAPK/Components/CreateAPK"));
const News = lazy(() => import("./Page/News"));
const NewsDetail = lazy(() => import("./Page/NewsDetail"));
const Learn = lazy(() => import("./Page/Learn"));
const EmailVerify = lazy(() => import("./Page/EmailVerify"));
const MyAccount = lazy(() => import("./Page/MyAccount"));
const ResetPassword = lazy(() => import("./Page/ResetPassword"));
const Play = lazy(() => import("./Page/Play"));
const Camp = lazy(() => import("./Page/Camp"));
// const MobileSignup = lazy(() => import("./Page/MobileSignup"));
const TokenIFrame = lazy(() => import("./Common/Component/TokenIframe"));

const App = () => {
  return (
    <Router>
      <SuspenseWrapper>
        <WizAppModalProvider>
          {/* main */}
          <Route exact path="/" component={Home} />

          {/* build */}
          <Route
            exact
            path={[
              "/builder",
              "/builder/:pId",
              "/builder_edit/:pId",
